trait Variance { type Rank; }
trait PrivatePow<T, U> { type Output; }
trait CoordinateSystem { type Dimension; }

impl<U, V> Mul<UInt<U, V>> for UInt<(), ()> {
    type Output = UInt<(), ()>;
}
impl<T, U, V, W> PrivatePow<T, UInt<U, V>> for W
